const getImageProperty = (layout, property) => {
  const image = images.find((img) => img.layout === layout);
  return image ? image[property] : null;
};

export const getParticipantsNumber = (layout) => getImageProperty(layout, "participantsNumber");

export const getTotalCapacity = (layout) => getImageProperty(layout, "total");

export const getSelectedLayoutName = (layout) => getImageProperty(layout, "layoutName");


export const getNewPresenterLayout = (participantsNumber) => {
  const sortedImages = [...images].sort(
    (a, b) => a.participantsNumber - b.participantsNumber
  );
  const image = sortedImages.find(
    (img) => img.participantsNumber >= participantsNumber
  );
  return image ? image.layout : null;
};



